	if (src == undefined) {
		Log("Error checking latest version, ignoring...");
		updatemsg = "Error checking latest version.";
		txtUpdate.filters = [new GlowFilter(0xFF0000, 255, 25, 25, 1, 3, false, false)];
		return;
	}
	var l:Array = src.split(".", 5);
	latestVer = new Version(l[0], l[1], l[2], l[3]);
	if (latestVer.newerThan(version)) {
		updateAvailable = true;
		txtUpdate.filters = [new GlowFilter(0x00FF00, 255, 25, 25, 1, 3, false, false)];
		updatemsg = "An update (" + latestVer + ") is available, clear yer cache!";
	} else {
		updateAvailable = false;
		updatemsg = "No updates are available.";
